            "def": " Claridade, que o sol dá á terra. Espaço de tempo, que vai do nascer ao pôr do sol. Espaço de vinte e quatro horas. Qualquer parte ou momento dessas vinte e quatro horas: a revolução foi no dia 1 de Dezembro. "
